// Layout
import LayoutEspecial from '../Layouts/LayOutMenu';


// Pages

import MenuEspecialidades from '../Pages/AdminRestaurante/Especialidades';
import Login from '../Pages/Login';
import InsertBebidaHelada from '../Pages/AdminRestaurante/AgregarBebidasHeladas';


const routes = [{

    path: '/AdminRestaurante',
    component: LayoutEspecial,
    exact: false,
    routes: [
        {
            path: "/AdminRestaurante/Especialidades",
            component: MenuEspecialidades,
            exact: true

        },
        {
            path: "/AdminRestaurante/AgregarBebidaHelada",
            component: InsertBebidaHelada,
            exact: true
        }
    ]

},
{
    path: '/',
    component: Login,
    exact: false,


}
];


export default routes;
